import myMap from "../../images/map.png";
const Map = () => {
  const iconStyling = {
    width: "30px",
    height: "30px",
  };

  const testStyle = {
    background: "red",
  };
  return (
    <div className="bg-amber-600 mt-8 col-span-1 mr-20 rounded-lg pt-5 flex flex-col ">
      <div
        style={testStyle}
        className="info-logo mb-5 font-serif text-center text-slate-50 flex"
      >
        <h1
          style={iconStyling}
          className="rounded-full border-2 content-center"
        >
          i
        </h1>
      </div>
      <img className="rounded-lg" src={myMap} alt="" />
    </div>
  );
};
export default Map;
